    false,nt"url": null,nt"notes": "This annual narrative report for Ninepipe
    NWR outlines Refuge accomplishments during the 1985 calendar year. The report begins
    with a summary of the year's highlights and weather conditions. The report includes
    a planning section which discusses research and investigations. Refuge administration
    is outlined; information about personnel, youth programs, volunteer programs, funding,
    and safety is given. Habitat management is also covered; subjects include wetlands,
    grasslands, grazing, fire management, and pest control. The wildlife section of
    the report discusses wildlife diversity, endangered and threatened species, waterfowl,
    marsh birds and waterbirds, shorebirds, raptors, and fisheries resources. The public
    uses of the Refuge described in this report include outdoor classrooms, interpretive
    programs, hunting, fishing, wildlife observation, outdoor recreation, and law enforcement.
    The equipment and facilities section of the report provides information about new
    construction. Cooperative programs are provided at the end. Refuge brochures and
    field guides are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
